import React from 'react'

import classes from './todoForm.module.css'

const todoForm = () => {
    return (
        <form className={classes.inputField}>
            <input type="text" placeholder="Add your new todo" />
            <button><i class="fas fa-plus"></i></button>
        </form>
    )
}

export default todoForm
